import {Link} from 'react-router-dom'

const Button = (props) => {
  return (
    <div>
      <Link
      onClick={props.onClick}
      to={props.links ? props.uri : ""}
      style={{backgroundColor: props.color}}
      className={props.className}>{props.text}
      </Link>
    </div>
  )
}

export default Button
